  const loadReceptionlist = async ()=>{
    try {
      let token = sessionStorage.getItem("token");
      let response = await axios.get(ApiEndPoint.getReception,{
        headers: {Authorization : `Bearer ${token}` }
      })
      console.log(response)
    } catch (err) {
      console.log(err)
    }
  }

